import React, { Component } from 'react';
import { render } from 'react-dom';
import { BrowserRouter as Router, Route, Link, withRouter } from 'react-router-dom';

class Quiz extends Component {
  propTypes: {
      match: PropTypes.object.isRequired,
      location: PropTypes.object.isRequired,
      history: PropTypes.object.isRequired
    }
    componentDidMount(){
      $('.content').fadeOut(0).fadeIn(300);
      $('.outline').hide();
      gtag('event', 'Stage', {'event_category':'load', 'event_label':'style-quiz'}); 
      gtag('config', 'UA-107877274-1',{'page_title': 'fit_profile_update','page_location': 'http://www.poseding.com/style-quiz','page_path': '/style-quiz'});
      
      Loggr.Log.trackUser(uid, "", "Take style quiz clicked. Navigated to quiz page.");
      window.hObj = this.props.history;

      var questions = [{
    question: "What's your skin color?",
    choices: ['<label for="q1" class="skin-tone" style="background:#FDEEC7"></label>','<label for="q2" class="skin-tone" style="background:#FBC5A4"></label>','<label for="q3" class="skin-tone" style="background:#FCBD84"></label>','<label for="q4" class="skin-tone" style="background:#A87256"></label>','<label for="q5" class="skin-tone" style="background:#633C1D"></label>'],
    correctAnswer:2
},{
    question: "How do you describe your shoulders?",
    choices: ['<label for="q1" class="shoulders">Broad</label>','<label for="q2" class="shoulders">Medium</label>','<label for="q3" class="shoulders">Narrow</label>'],
    correctAnswer:2
},{
    question: "What's your height and weight?",
    choices: ['<label class="shoulders" style="background:#fff;width:200px;font-size: 16px;">Height: (example: 5.4)</label><input id="heightVal" type="number" class="htwt" width="24" />','<label style="background:#fff;width:200px;font-size: 16px;" class="shoulders">Weight in kg: (example: 50)</label><input type="number" id="weightVal" class="htwt" width="24" />'],
    correctAnswer:0
}];

var skinTones = ['#FDEEC7','#FBC5A4','#FCBD84','#A87256','#633C1D'];
var shoulders = ['broad','medium','narrow'];


function createQuestionElement(index) {
    var qDiv = document.createElement('div');
    qDiv.setAttribute('id','question');
    var question = document.createElement('p');
    question.innerHTML = questions[index].question;
    qDiv.appendChild(question);
    qDiv.appendChild(createRadios(index));
    return qDiv;
}

function createRadios(index) {
    var radioList = document.createElement('ul');
    var str;
    for(var i=0; i<questions[index].choices.length ; i++){
        var item = document.createElement('li');
        var input = '<input type="radio" name="answer" id="q'+(i+1)+'" value="' + (index == 0 ? skinTones[i] : shoulders[i])
            + '" />';
        input += questions[index].choices[i];
        if(index <= 1) 
          item.innerHTML =input;
        else
          item.innerHTML =questions[index].choices[i];
        radioList.style.marginTop = '10px';
        radioList.appendChild(item);
    }
    
    return radioList;
}

var questionCounter = 0;
var numCorrect = 0;
var firstDiv = createQuestionElement(questionCounter);
$('#quiz').append(firstDiv);

var radios = document.getElementsByName('answer');
//var button = document.getElementById('button');

$('#button').on('click', function() {
    if(questionCounter == 0) {
      sessionStorage.setItem('skinTone', $("input[name=answer]:checked").val());
      gtag('event', 'Stage', {'event_category':'style-quiz', 'event_label':'style-quiz-skin-color'}); 
      gtag('config', 'UA-107877274-1',{'page_title': 'style-quiz-skin-color','page_location': 'http://www.poseding.com/style-quiz-skin-color','page_path': '/style-quiz-skin-color'});
      Loggr.Log.trackUser(uid, "", "Style quiz. Skin color entered: "+$("input[name=answer]:checked").val());
    } else if(questionCounter == 1) {
      sessionStorage.setItem('shoulderWidth', $("input[name=answer]:checked").val());
      gtag('event', 'Stage', {'event_category':'style-quiz', 'event_label':'style-quiz-shoulders'}); 
      gtag('config', 'UA-107877274-1',{'page_title': 'style-quiz','page_location': 'http://www.poseding.com/style-quiz-shoulders','page_path': '/style-quiz-shoulders'});
      Loggr.Log.trackUser(uid, "", "Style quiz. Skin color entered: "+$("input[name=answer]:checked").val());
    } else {
      sessionStorage.setItem('heightVal',$('#heightVal').val());
      sessionStorage.setItem('weightVal',$('#weightVal').val());
      sessionStorage.setItem('quizSize','L');
      var heightFirstPartCM = parseInt($('#heightVal').val().split('.')[0],10) * 30.48;
      var heightSecondPartCM = (parseInt($('#heightVal').val().split('.')[1],10)/12) * 30.48;
      var height = (heightFirstPartCM + heightSecondPartCM)/100;
      var weight = parseInt($('#weightVal').val(),10);
      var weightHeightRatio = weight / height;
      var bmi = weightHeightRatio / height;
      sessionStorage.setItem('bmi',bmi);
      localStorage.setItem('quizFlow','true');

      if(bmi < 18.5) {
        sessionStorage.setItem('quizSize','m');
        localStorage.setItem('userSize','m');
      } else if(bmi >= 18.5 && bmi < 24.9) {
        sessionStorage.setItem('quizSize','l');
        localStorage.setItem('userSize','l');
      } else if(bmi >= 24.9 && bmi < 26) {
        sessionStorage.setItem('quizSize','xl');
        localStorage.setItem('userSize','xl');
      } else {
        sessionStorage.setItem('quizSize','xxl');
        localStorage.setItem('userSize','xxl');
      }
      Loggr.Log.trackUser(uid, "", "Style quiz. Height entered: "+$('#heightVal').val());
      Loggr.Log.trackUser(uid, "", "Style quiz. Weight entered: "+$('#weightVal').val());
      Loggr.Log.trackUser(uid, "", "Style quiz. Size computed."+sessionStorage.getItem('quizSize'));
      localStorage.setItem('faceH', 242);
      localStorage.setItem('faceW', 242);
      localStorage.setItem('faceX', 110);
      localStorage.setItem('faceY', 80);
      localStorage.setItem('pic', 'data:image/png;base64,');
    }
    if(questionCounter == 2) {
      hObj.push('/fit-profile/update');
    }
    if(radios[questions[questionCounter].correctAnswer].checked){
        numCorrect++;
    }
    
    questionCounter++;
    $('#questionNum').html((questionCounter+1)+' of 3');
    $('#question').remove();
    
    if(questionCounter<questions.length){
        var nextDiv = createQuestionElement(questionCounter);
        //$('#quiz').append(nextDiv);
        document.getElementById('quiz').appendChild(nextDiv);
    } else {
        document.getElementById('quiz').appendChild(displayScore());
    }

    if(questionCounter == 2) {
      $('#button').html('<span>Finish</span>');
    }
});

function displayScore() {
    var para = document.createElement('p');
    para.innerHTML = 'You got ' + numCorrect + ' questions out of ' +
        questions.length + ' right!!!';
    return para;
}





    }
    render(){
        return (<div className="content">
            <div style={{fontSize:'22px',textAlign:'center',lineHeight:'28px',paddingTop:'70px',color: '#4b4b4b',fontFamily:'a'}}>STYLE QUIZ - <span id="questionNum">1 of 3</span></div>
            <div style={{fontSize:'18px',textAlign:'center',lineHeight:'28px',paddingTop:'12px',color: '#8e8c92',fontFamily:'Open Sans'}}><div id='quiz'></div>
            </div>
            <div className="btn-container" style={{bottom: '10px'}}>
            <Link to="/search/update" className="btn upload-btn" style={{width:'226px',top:'30px',left:'6px'}}><span>Next</span></Link>
            </div>
          </div>
          );
    }
}

export default Quiz;